import React from 'react'
import Today from '../Today/Today'
import Tomorrow from '../Tomorrow/Tomorrow'

function NextWeek()  {
    return (
        <div className='NextWeek'>
            <Today />
            <Tomorrow />
        </div>
    )
}

export default NextWeek
